import * as S from "./styles";
import { Room } from "./Room";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";

import mapIcon from "../../images/pin.png";

export const RoommatesMap = () => {
  return (
    <S.RoommatesMapWrapper>
      <S.RoommatesMapContent>
        <S.Rooms>
          <Room />
          <Room />
          <Room />
          <Room />
          <Room />
          <Room />
          <Room />
        </S.Rooms>

        <S.Map id="map">
          <MapContainer
            center={[-22.199547, -47.3804479]}
            zoom={15}
            style={{ width: "100%", height: "100%" }}
          >
            <TileLayer
              url={`https://api.mapbox.com/styles/v1/mapbox/light-v10/tiles/256/{z}/{x}/{y}@2x?access_token=${process.env.REACT_APP_MAPBOX_TOKEN}`}
            />
            <Marker position={[-22.199547, -47.3804479]}>
              <Popup>
                A pretty CSS3 popup. <br /> Easily customizable.
              </Popup>
            </Marker>

            <Marker icon={mapIcon} position={[-22.199547, -47.3804479]}>
              <Popup>
                A pretty CSS3 popup. <br /> Easily customizable.
              </Popup>
            </Marker>
          </MapContainer>
        </S.Map>
      </S.RoommatesMapContent>
    </S.RoommatesMapWrapper>
  );
};
